export default function loginScreen() {
  function handleRegister() {
    window.location = "/register";
  }
  return (
    <div className="loginScreen">
      <p>Login Screen</p>
      <button type="button" class="btn btn-primary" onClick={handleRegister}>
        Primary
      </button>
    </div>
  );
}
